    <div id="top">
        <div id="title">
            <span id="mainTitle" class="text">Krunker Logo Maker</span>
            <div id="topInfo">
                <a href="https://hitthemoney.com">hitthemoney</a><span class="text"> x </span><a href="https://hoodgail.github.io">Hoodgail</a><span class="text"> |</span>
                <a style="cursor: pointer;" onclick="showChangelog()" id="version"></a>
            </div>
        </div>

    <div id="settings">
        <h1 id="settingsHeader" onmouseout="checkSettings('out')" onmouseover="checkSettings('hover')"
            onclick="checkSettings('click')">Settings</h1>
        <div class="settName" id="hue" title=""><span id="hueText">Color Hue </span><input type="number" class="sliderVal" id="hueInput" min="0"
                max="360" value="0" onkeypress="d.getElementById('hueSlider').value = this.value; changeHue();"
                style="margin-right: 0px;border-width:0px">
            <div class="slidecontainer">
                <input type="range" id="hueSlider" min="0" max="360" step="5" value="0" class="sliderM"
                    oninput="d.getElementById('hueInput').value = this.value; changeHue();">
            </div>
        </div>
        <div class="settName" id="size" title=""><span id="sizeText">Font Scale </span><input type="number"
                class="sliderVal" id="sizeInput" min="0" max="2" value="1"
                onkeypress="d.getElementById('sizeSlider').value = this.value; changeSize();"
                style="margin-right: 0px;border-width:0px">
            <div class="slidecontainer">
                <input type="range" id="sizeSlider" min="0" max="2" step="0.1" value="1" class="sliderM"
                    oninput="d.getElementById('sizeInput').value = this.value; changeSize();">
            </div>
        </div>
        <div class="settName" id="box" title=""><span id="boxText">Text Box </span><label id="boxCheck" class="switch"
                style="margin-left:10px">
                <input type="checkbox" onclick="textBox(this.checked)" checked="true"><span
                    class="slider"></span></label></div>
    </div>
